import './Hero.css';
import HeroImage from './hero-img.svg';
impp

function Hero(){
    return(
        <div className="HeroSection">
            <div className="HeroPart1">
                <h4>REELM <span>$8.57</span><br />SEED OIL</h4>
             <p>
                When your skin’s oil glands go into overdrive, they leave behind a slick, waxy <br />substance called sebum. A serum may be able to help give your skin care <br />routine a boost, controlling oil and offering a few added benefits along the way.<br /> We’ve put together this list of the best skin serums for oily skin to give you a <br />glow you can feel good about.
             </p>
            </div>

            <div className="HeroPart2">
                <img src={HeroImage} />
            </div>
        </div>
    );
}

export default Hero;
